To Gillian on Her 37th Birthday (1996)

David loves his wife, Gillian. Unfortunately, she died two years ago. David deals with his grief by continuing his romance with Gillian during walks with her &quot;ghost&quot; on the beach at night. While David lives in the past, other family problems crop up in the present in the real world....



